import Link from "next/link";
import { Space } from "antd";

const MenuBloc = ({ link, title }) => {
  return (
    <Link href={link}>
      <a className="menu-bloc">
        <Space direction="vertical" align="center">
          <ion-icon name="home"></ion-icon>
          <span>{title}</span>
        </Space>
      </a>
    </Link>
  );
};

export default MenuBloc;
